import { Routes, Route } from "react-router-dom";

import Home from "./routes/home/home.comonent";

import "./categories.styles.scss";

const App = () => {
  return;
  <Routes>
    <Route path="/" element={<Home />} />
  </Routes>;
};

export default App;
